import React from "react";
import { Doughnut } from "react-chartjs-2";

function Chart(props) {
  return (
    <div>
      CHart
      <ul>
        { props.data.map((list) => {
          return <li key={list.id}>{list.donate}</li>;
        })}
      </ul>
    </div>
  );
}

export default Chart;
